import React from "react";
import "./Search.css";

export default function Search() {
  return (
    <div>
      <form>
            <input
              id="search-city"
              type="text"
              className="form-control"
              placeholder="Search a city"
            />
            <button
              type="submit"
              className="btn btn-primary"
              id="submit-button"
            >
              Search
            </button>
      </form>
    </div>
  );
}
